import React from 'react'
import { useState, useEffect } from 'react'
import axios from 'axios'

const ForgotPassword = () => {
    const [email, setEmail] = useState('barreahmed600@gmail.com')

    const Change = (e) => {
        setEmail(e.target.value)
    }

    useEffect(() => {
        axios
            .get('http://localhost:3000/login/one')
            .then((res) => {
                // window.location.replace('/find')
                console.log(res)
            })
            .catch((err) => {
                // window.location.replace('/find')
                console.log(err)
            })
    })

    return (
        <div>
            <form>
                <p>Enter your email for a reset link </p>
                <input
                    onChange={Change}
                    value={email}
                    placeholder="Enter your email"
                />
                <button> Send </button>
            </form>{' '}
        </div>
    )
}

export default ForgotPassword
